import styled from "styled-components";

export default styled.div`
    background-image: radial-gradient(#3151D6 -10vh, white 1000vh);
    box-shadow: 0 0 20px 0 rgba(82, 95, 110, 0.3);
    height: 70vh;
    width: 100%;
    border-radius: 0% 0% 40% 40% / 76% 76% 15% 15% ;
    bottom: 100px;
`;
